import "./Message.scss"

const MessageItem=(props)=>{;
  return(
    <li>{props.message}</li>
  );
}

const Message=(props)=>{

    let MessagesElements=props.MessagesData.map(message=><MessageItem message={message.message}></MessageItem>)
    return(
        <div className="Message">
        <ul>
          {MessagesElements}
        </ul>
        <textarea></textarea>
        <button onClick={alert("hello")}></button>
        </div>
    );
}

export default Message
